// PayrollContainer.js
import { useEffect, useState } from "react";
import PayrollDisplay from "./PayrollDisplay"; // Import the presentational component

const PayrollContainer = () => {
  const [payrollData, setPayrollData] = useState({
    name: "Armando L Lanugon",
    idNumber: "2021-0126-001",
    bankAccount: "AUB 916-10-55635-1",
    department: "Graphics",
    payrollPeriod: "September 1-30, 2024",
    payrollDate: "October 16, 2024",
    rate: "70%",
    client: "Graphics Design Work",
    client2: "Aaron",
    grossAmount: "13,976.91",
    grossAmount2: "4,602.00",
    netAmount: "9,783.84",
    netAmount2: "3,221.40",
    deductions: "None",
    deductionAmount: "0.00",
    totalAmount: "13,005.24",
  });

  useEffect(() => {
    fetch("/api/payroll")
      .then((response) => response.json())
      .then((data) => {
        setPayrollData(data);
      })
      .catch((error) => console.error("Error fetching payroll data:", error));
  }, []);

  return <PayrollDisplay payrollData={payrollData} />;
};

export default PayrollContainer;
